import React from 'react';
import s from './Item.module.css'
import {NavLink} from 'react-router-dom';
const Item = (props) => {
  console.log(props.state);
    return (
      <div className={s.wrapper}>
        <img className={s.logo} src={props.state.source} alt="" />
        <NavLink className={s.operator} to={() => '/checklist-' + props.state.id}>
          <h3 className={s.title}>{props.state.name}</h3>
        </NavLink>
      </div>
    );
        }
export default Item;
